import React from "react";
import {Button, Input, Table} from 'antd';
import {Icon} from '@ant-design/compatible';
import {SmileOutlined} from "@ant-design/icons";


export default class NewTable extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            loading: 'boolean',
            getTime:this.getTime(),
            currentDate:'',
            table: {
                struct: [
                    {title: '姓名', dataIndex: 'name', key: 'name', alias: 'center'},
                    {title: '性别', dataIndex: 'sex', key: 'sex', alias: 'center'},
                    {title: '年龄', dataIndex: 'age', key: 'age', alias: 'center'},
                    {title: '登录状态', dataIndex: 'online', key: 'online', alias: 'center'},
                    {title: '手机号码', dataIndex: 'Num', key: 'Num', alias: 'center'},
                    {title: '地址', dataIndex: 'address', key: 'address', alias: 'center'},
                    {title: '操作', dataIndex: 'operation', key: 'operation', alias: 'center'},
                ]
            }

        }
    }



    componentDidMount() {
        setInterval(this.getTime(),1000)
    }

    render() {
        let timer=setInterval(function (){})
        let {table} = this.state
        // let pagination={
        //     total:50,
        //     showSizeChanger:true,//是否可以改变pageSize
        //     showQuickJumper:true//是否可以快速跳转到某页
        // }
        return (
            <div>
                <h1>{this.getTime()}</h1>
                {this.state.table.struct.map((item, index) => {
                    return (
                        <div key={index}>
                            <p>{item.title}</p>
                            <p>{item.dataIndex}</p>
                        </div>
                    )
                })}
                <input placeholder='请输入'/>
            </div>
        )
    }
}
